public synchronized String getDiagnostics() {
  LocalizationStatusProtoOrBuilder p = viaProto ? proto : builder;
  if (this.diagnostics != null) {
    return this.diagnostics;
  }
  if (!p.hasDiagnostics()) {
    return null;
  }
  this.diagnostics = p.getDiagnostics();
  return diagnostics;
}
